import { AspectRatio } from '@chakra-ui/react';
import { ReactElement } from 'react';

import MainBg from '../../video/Bg.mp4';
import ForVideo from '../../video/forVideo.png';

export function BackgroundImage(): ReactElement {
  return (
    <>
      <video
        loop
        autoPlay
        width="100%"
        style={{ position: 'fixed', top: '63px', opacity: '1' }}
      >
        <source type="video/mp4" src={MainBg} />
        <track kind="captions" src="./friday.vtt" lang="en" />
      </video>
      <div
        style={{
          position: 'absolute',
          zIndex: 2,
          backgroundImage: ForVideo,
          backgroundRepeat: 'repeat',
          backgroundPositionX: '0',
          backgroundPositionY: '0',
        }}
      >
        1
      </div>
    </>
  );
}
